import React from 'react';
import './footer.scss'
import FooterTop from "../FooterTop/FooterTop";
import FooterMiddle from "../FooterMidlle/FooterMiddle";

const Footer = () => {
    return (
        <footer className='footer'>
            <FooterTop/>
            <FooterMiddle/>
        </footer>
    );
};

export default Footer;
